import React,{useState} from 'react';
import { useNavigate } from "react-router-dom";
import axios from "axios"
export default function Login() {
    const navigate = useNavigate();
    const [getRegisterData, setRegisterData] = useState({})
    const handleChange = (event) =>{
        setRegisterData((prev)=>({...prev,[event.target.name]:event.target.value}))
    }
    const login = async () =>{
        try {
            const { data } = await axios.post('http://localhost:7000/user-ms/login',getRegisterData,{
                headers: {
                  'Content-Type': 'application/json'
                }
            });
            navigate("/")
            localStorage.setItem("x-access-token",data.token)
        } catch (error) {

        }

    }
    return (
        <main className="form-signin" style={{padding:"10% 0",margin:"0 auto",maxWidth:"400px"}}>
            {/* <form> */}
                <div className="form-floating mb-3 text-center font-bold">
                    E - Auction
                </div>
                <div className="form-floating mb-3">
                    <input type="text" className="form-control" id="floatingInput" name="firstName" onChange={handleChange}/>
                    <label htmlFor="floatingInput">First Name</label>
                </div>
                <div className="form-floating mb-3">
                    <input type="text" className="form-control" id="floatingInput" name="lastName" onChange={handleChange}/>
                    <label htmlFor="floatingInput">Last Name</label>
                </div>
                <div className="form-floating mb-3">
                    <input type="email" className="form-control" id="floatingInput" name="email" onChange={handleChange}/>
                    <label htmlFor="floatingInput">Email address</label>
                </div>
                <div className="form-floating  mb-3">
                    <input type="password" className="form-control" id="floatingPassword" name="password" onChange={handleChange}/>
                <label htmlFor="floatingPassword">Password</label>
                </div>

                <button className="w-100 btn btn-lg btn-dark" type="submit" onClick={login}>Sign in</button>

            {/* </form> */}
        </main>
    )
}
